let yAxisData=[];
for(var i=0;i<datasource.length;i++){
    if(datasource[i]["纹饰"].match("蛇纹"))yAxisData[0]++;
}

class Chartdemo3 extends React.Component {
    constructor(props) {
        super(props);
        this.state={
          chooseChart:'1',
          yAxis:yAxisData,
        };
      }

    render(){
        return(
            <div>
                <Card style={{ width: 1000 }}>
                  
                  <Page3 />
                </Card>
            </div>
        )

    }
}

export default Chartdemo3;
